import "./CampoDeDigitacao.css";

function CampoDeDigitacao() {
    return (
        <div className='form__campo-digitacao' >
            <label for='email'>E-mail ou usuário</label>
            <input 
                type='email'
                placeholder='Digite o seu e-mail ou usuário'
                required
                id='email'
            />
        </div>
    );
};

export default CampoDeDigitacao;
